import React from "react";
import styles from "../styles/DataSeparator.module.css";

function DateSeparator(props) {
    const { data, styleText, styleContainer } = props;
    return (
        <div className={styles.separator} style={styleContainer}>
            <span className={styles.text} style={styleText}>
                {data}
            </span>
        </div>
    );
}

export default React.memo(DateSeparator);
